### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Probability Distributions**
   - **Discrete Random Variables:**
     - **Uniform Distribution:**
       - PMF: \( f_X(k) = \frac{1}{n} \)
       - CDF: \( F_X(x) = \frac{k-a+1}{n} \)
       - Mean: \( E[X] = \frac{a+b}{2} \)
       - Variance: \( Var(X) = \frac{n^2-1}{12} \)
     - **Bernoulli Distribution:**
       - PMF: \( f_X(k) = p \) for \( x=1 \), \( 1-p \) for \( x=0 \)
       - Mean: \( E[X] = p \)
       - Variance: \( Var(X) = p(1-p) \)
     - **Binomial Distribution:**
       - PMF: \( f_X(k) = {}^nC_k p^k (1-p)^{n-k} \)
       - Mean: \( E[X] = np \)
       - Variance: \( Var(X) = np(1-p) \)
     - **Geometric Distribution:**
       - PMF: \( f_X(k) = (1-p)^{k-1} p \)
       - Mean: \( E[X] = \frac{1}{p} \)
       - Variance: \( Var(X) = \frac{1-p}{p^2} \)
     - **Poisson Distribution:**
       - PMF: \( f_X(k) = \frac{e^{-\lambda} \lambda^k}{k!} \)
       - Mean: \( E[X] = \lambda \)
       - Variance: \( Var(X) = \lambda \)

   - **Continuous Random Variables:**
     - **Uniform Distribution:**
       - PDF: \( f_X(x) = \frac{1}{b-a} \)
       - CDF: \( F_X(x) = \frac{x-a}{b-a} \)
       - Mean: \( E[X] = \frac{a+b}{2} \)
       - Variance: \( Var(X) = \frac{(b-a)^2}{12} \)
     - **Exponential Distribution:**
       - PDF: \( f_X(x) = \lambda e^{-\lambda x} \)
       - CDF: \( F_X(x) = 1-e^{-\lambda x} \)
       - Mean: \( E[X] = \frac{1}{\lambda} \)
       - Variance: \( Var(X) = \frac{1}{\lambda^2} \)
     - **Normal Distribution:**
       - PDF: \( f_X(x) = \frac{1}{\sigma \sqrt{2\pi}} \exp \left( -\frac{(x-\mu)^2}{2\sigma^2} \right) \)
       - Mean: \( E[X] = \mu \)
       - Variance: \( Var(X) = \sigma^2 \)
     - **Gamma Distribution:**
       - PDF: \( f_X(x) = \frac{\beta^\alpha}{\Gamma(\alpha)} x^{\alpha-1} e^{-\beta x} \)
       - Mean: \( E[X] = \frac{\alpha}{\beta} \)
       - Variance: \( Var(X) = \frac{\alpha}{\beta^2} \)
     - **Beta Distribution:**
       - PDF: \( f_X(x) = \frac{\Gamma(\alpha+\beta)}{\Gamma(\alpha)\Gamma(\beta)} x^{\alpha-1} (1-x)^{\beta-1} \)
       - Mean: \( E[X] = \frac{\alpha}{\alpha+\beta} \)
       - Variance: \( Var(X) = \frac{\alpha \beta}{(\alpha+\beta)^2(\alpha+\beta+1)} \)

#### 2. **Inequalities and Theorems**
   - **Markov’s Inequality:**
     \[ P(X \geq c) \leq \frac{\mu}{c} \]
   - **Chebyshev’s Inequality:**
     \[ P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2} \]
   - **Weak Law of Large Numbers:**
     \[ P(|\overline{X} - \mu| > \delta) \leq \frac{\sigma^2}{n\delta^2} \]
   - **Central Limit Theorem (CLT):**
     \[ \frac{Y - n\mu}{\sqrt{n\sigma}} \approx \text{Normal}(0,1) \]

#### 3. **Moment Generating Functions (MGF)**
   - For a Bernoulli random variable \( X \) with parameter \( p \):
     \[ M_X(t) = 1 - p + pe^t \]
   - For the centralized version of \( X \):
     \[ M_Y(t) = e^{-0.3t} (0.7 + 0.3e^t) \]

#### 4. **Joint Distributions and Independence**
   - **Joint PMF and PDF:**
     - For discrete random variables \( X_1 \) and \( X_2 \):
       \[ f_{X_1,X_2}(x_1, x_2) \]
     - For continuous random variables \( X \) and \( Y \):
       \[ f_{XY}(x, y) \]
   - **Independence:**
     - \( X_1 \) and \( X_2 \) are independent if \( f_{X_1,X_2}(x_1, x_2) = f_{X_1}(x_1) f_{X_2}(x_2) \)

#### 5. **Sample Mean and Variance**
   - **Expected Value of Sample Mean:**
     \[ E[\overline{X}] = \mu \]
   - **Variance of Sample Mean:**
     \[ Var(\overline{X}) = \frac{\sigma^2}{n} \]

#### 6. **Probability Calculations**
   - **Conditional Probability:**
     \[ P(A|B) = \frac{P(A \cap B)}{P(B)} \]
   - **Cumulative Distribution Function (CDF):**
     \[ F_X(x) = P(X \leq x) \]

